create table user_relationships_backup
(
    id                      int unsigned auto_increment
        primary key,
    user_id                 int unsigned                         not null comment '用户ID',
    is_activated            tinyint(1) default 0                 not null comment '该用户是否已激活',
    direct_superior_user_id int unsigned                         not null comment '直接上级的用户ID',
    lft                     int unsigned                         not null comment '用户关系树节点左值',
    rgt                     int unsigned                         not null comment '用户关系树节点右值',
    created_at              datetime   default CURRENT_TIMESTAMP not null,
    updated_at              datetime                             null,
    deleted_at              datetime                             null
)
    collate = utf8mb4_unicode_ci;

